@stefsanjati It took me nearly 30 years to figure it out and another two to truly accept and figure myself out. It went like this:

“Maybe I’m trans” *Stumbles onto @stefsanjati and @mayavhenry on YouTube* 
“Holy shit I’m trans”

@CateSpice @PsychicRefugee Wow...

Imagine telling someone they can only feel comfortable in their own skin if someone else thinks they’re pretty...

What a monster.

@jk_rowling It’s been a few days and I’ve had time to better collect some thoughts. I wanted to share them with you. This is not an attempt to sway you, this is so long and thanks. 

“Help will always be given at Hogwarts to those who ask for it.”

#HufflepuffNoMatterWhat https://t.co/u8E9dKd0ym
